import RequestTable from '../storeTable/Store_Table'
// import axios from 'axios';
import {Link} from 'react-router-dom';
import {Button, Container} from 'react-bootstrap'
import UserInformation from '../userInformation/User_information.js';
import styled from 'styled-components';
import HeaderPages from '../header/Header_pages';

const StoreDashboard = () =>{

return(
    <>
    <HeaderPages/>
    <MainContainer >

    <UserInformation />


    <Link to="/inventory"> <Btn className="btn btn-md mt-4 mb-4 float-right"> Inventory </Btn> </Link>
    <Link to="/recieveitems"> <Btn className="btn btn-md mt-4 mb-4 mr-2 float-right"> Recieved Item </Btn> </Link>


    <RequestTable/>
    </MainContainer>
    </>
)


}

export default StoreDashboard;

const Btn = styled(Button)`
    background :#EFBB20;
    border: none; 
    &:hover{
    background: #0e8ccc;
}
`;
const MainContainer = styled(Container)`
    width: 100%;
    height: auto;
    min-height: 100%;
    min-height: 100vh;
    margin-top:100px;
`;
